import React from 'react';
import ReactDom from 'react-dom';

const myName = "Talha Bajwa";

ReactDom.render(
  <>
    <h1>My name is {myName}, </h1>
    <h2>My lucky number is {5+5} </h2>
  </>,
  document.getElementById('root')
);
